import ReactDOM from 'react-dom';
import TestGame from './TestGame';



import {  Config, Polygon, DAppProvider, DEFAULT_SUPPORTED_CHAINS} from "@usedapp/core";
/*import { Polygon} from 'src/servises/network/Polygon'*/

const myNetworks = [...DEFAULT_SUPPORTED_CHAINS]
const polygon = myNetworks.find(chain => chain.chainId === Polygon.chainId)
polygon.rpcUrl = 'https://polygon-rpc.com/'

(async () => { 
  ReactDOM.render(
    <>
    
      <DAppProvider config={{
      readOnlyChainId: Polygon.chainId,
      readOnlyUrls: {
        [Polygon.chainId]: '<https://polygon-rpc.com/>',
        
      },
      networks: myNetworks,
      }}>
        <TestGame />,
      </DAppProvider>
   

    
    </>,
  document.getElementById('root'),
)})();
